class Planner extends React.Component{

    renderCell(i) {
        return <Cell />;
      }
    
      render() {
        const status = 'Next player: X';
    
        return (
          <div>
            <div className="status">{status}</div>
            <div className="board-row">
              {this.renderCell(0)}
              {this.renderCell(1)}
              {this.renderCell(2)}
            </div>
            <div className="board-row">
              {this.renderCell(3)}
              {this.renderCell(4)}
              {this.renderCell(5)}
            </div>
            <div className="board-row">
              {this.renderCell(6)}
              {this.renderCell(7)}
              {this.renderCell(8)}
            </div>
          </div>
        );
      }

}

